import React from "react";
import ReactDOM from "react-dom";
import faker from 'faker';
import CommentDetail from './CommentDetail';


const App = () => {
  return (
    <div className="ui container comments">

    <CommentDetail author="Sam" timeAgo="Today at 4:45PM" comment="This is so cool!"/>
    <CommentDetail author="Alex" timeAgo="Today at 6:11PM" comment="I dont'"/>
    <CommentDetail author="Jane" timeAgo="Yesterday at 7:05PM"/>
 
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector("#root"));
